import React, { Component } from 'react';

class Main extends Component {

  render() {
    return (
      <div className="main-page">
        <div className="info">
          <div className="info-item">
            <div className="info-item__img">
              <img src="/img/user.svg" alt="img"/>
            </div>
            <div className="info-item-data">
              <span className="info-item__title">62</span>
              <span className="info-item__desc">Users</span>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default Main;
